import React from "react";

export default function AddShiftDialog() {
  const getDate = (e) => {
    console.log(e.target.value);
  };
  return (
    <label>
      date:
      <input type={"date"} onChange={getDate}></input>
      from
      <input type={"time"}></input>
      to
      <input type={"time"}></input>
      tip:
      <input></input>
      <button>submit</button>
    </label>
  );
}
